import React from 'react'
import { getAllTopics } from '../utilities/forum-services';
import { useState } from 'react';
import { useEffect } from 'react';
import Topic from './topic'

const TopicList = ({history, logIn}) => {
    let [topic, setTopic] = useState([]);

    useEffect(()=>{
        getAllTopics()
        .then(data => {
            setTopic(data.topics)
            // setTopic = [...topic]
            console.log(data.topics);
            console.log(data.topics.topic_id)
        })
    }, [])
    console.log(topic)
    console.log(logIn)


    return (
            <ul>
                {topic.map((top) => {return <Topic key={top.topic_id} logIn={logIn} topic_id={top.topic_id} history={history} topic={top}></Topic>})}
            </ul>
    )
} /*doraditi*/

export default TopicList;
